import React from 'react';
import PropTypes from 'prop-types';

const ArticleTitleBar = (props) => (
  <h2>
    {props.title}
  </h2>
);


ArticleTitleBar.defaultProps = {
  title: ""
}

ArticleTitleBar.propTypes = {
  title: PropTypes.string
};

export default ArticleTitleBar;
